  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113891 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the Labrador
  Sea and North Atlantic Ocean from 2003-07-23 to 2003-08-29 and retrieved during
  cruise CARINA/06MT20030723. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-12 (CFC-12), DISSOLVED INORGANIC CARBON, DISSOLVED
  OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature
  (theta), SALINITY, SILICATE, WATER TEMPERATURE and pH. The instruments used to collect
  these data include CTD and bottle. These data were collected by Douglas Wallace
  of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine Biogeochemie
  and M. Rhein [affiliation unknown] as part of the CARINA/06MT20030723 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
